    return(
            <Swiper
                // modules={[EffectFade]}
                // effect="fade"
                slidesPerView={1}
                pagination={{ clickable: true}}
                navigation
            >
                {data.map( (item) => (
                    <SwiperSlide key={item.id}>
                        <img
                            width={"100%"}
                            src={item.image}
                            alt="Slider"
                            className='slider-item'>
                        </img>
                        <Button className='position-relative'>aa</Button>

                    </SwiperSlide>))}
            </Swiper>
    )
}

export default Slider;
